@wibmerfabio became well acquainted with our fun loving bikepark machine, the Torque CF, during his first video project of 2020 – the jaw dropping ‘Israel Is My Playground’ edit. 

The agile, playful handling and Category 5, ‘DH proven’, durability makes the Torque the perfect platform for Fabio’s unique approach to freeride mountain biking. So, it seemed the ideal place to start on a signature model project. On the 13th of April we released the Limited edition Torque CF Fabio Wibmer, a bike that not only looks like Fabio's bike but also rides like it.

